function countOnl(n) {
    $.ajax({
        method: "GET",
        url: "/count-onl"
    }).done(function(t) {
        var i = "";
        i = t < 2 ? `${t} Online` : `${t} Onlines`;
        $(`#${n}`).text(i);
        setInterval(function() {
            $.ajax({
                method: "GET",
                url: "/count-onl"
            }).done(function(t) {
                var i = "";
                i = t < 2 ? `${t} Online` : `${t} Onlines`;
                $(`#${n}`).text(i)
            }).fail(function(n) {
                console.log(n)
            })
        }, 3e4)
    }).fail(function(n) {
        console.log(n)
    })
}
